import React, { Fragment } from 'react';
import { Grid } from '@material-ui/core';

const ExpandedInfo = () => {
  return (
    <Fragment>
      <Grid style={{height: '100%'}} container justify="center" alignItems="center">
      Expanded Info
      </Grid>
    </Fragment>
  )
};

export default ExpandedInfo;
